import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="app-container">
      <Meetings />
      <Milestones />
      <Folders />
      <ClientFeedback />
    </div>
  );
};

const Meetings = () => {
  // Dummy data for meetings
  const meetings = [
    { date: 'March 26, 2024', time: '9:00 AM - 11:00 AM', title: 'Team Brainstorming Session' },
    // ...other meetings
  ];

  return (
    <div className="meetings-container">
      <h2>Meetings</h2>
      {meetings.map((meeting, index) => (
        <div key={index} className="meeting-item">
          <h3>{meeting.title}</h3>
          <p>{meeting.date}</p>
          <p>{meeting.time}</p>
        </div>
      ))}
    </div>
  );
};

const Milestones = () => {
  // Dummy data for milestones
  const milestones = [
    { title: 'Product Launch', date: 'May 10, 2024' },
    // ...other milestones
  ];

  return (
    <div className="milestones-container">
      <h2>Milestones</h2>
      {milestones.map((milestone, index) => (
        <div key={index} className="milestone-item">
          <h3>{milestone.title}</h3>
          <p>Estimated Completion Date: {milestone.date}</p>
        </div>
      ))}
    </div>
  );
};

const Folders = () => {
  // Dummy data for folders
  const folders = ['BRD.docx', 'SDD.xlsx', 'FRD.docx'];

  return (
    <div className="folders-container">
      <h2>Folders</h2>
      {folders.map((folder, index) => (
        <div key={index} className="folder-item">
          <p>{folder}</p>
        </div>
      ))}
    </div>
  );
};

const ClientFeedback = () => {
  // Dummy data for client feedback
  const feedbacks = [
    { client: 'Client A', message: 'The revised design exceeded our expectations! Lovely upgrade, it’s exactly what we needed. Thanks for being so responsive to our requests.' },
    // ...other feedback
  ];

  return (
    <div className="client-feedback-container">
      <h2>Client Feedback</h2>
      {feedbacks.map((feedback, index) => (
        <div key={index} className="feedback-item">
          <strong>{feedback.client}</strong>
          <p>{feedback.message}</p>
        </div>
      ))}
    </div>
  );
};

export default App;
